# class Solution(object):
def is_pal(s):
    return s==s[::-1]

def findPal2(s):
    prefix = ''
    length = len(s)
    N=1
    strr = s
    while is_pal(strr) is False:
        prefix = s[(-1*N):][::-1]
        strr = prefix+s
        N=N+1
    return prefix+s

def shortestPalindrome(s):
    ans = findPal2(s)
    print(ans)
    return ans



